(window.webpackJsonp=window.webpackJsonp||[]).push([[175],{528:function(n,h,t){"use strict";t.r(h);var i=t(44),g=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1134-nguoi-đe-cho-ta-đanh-ai"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1134-nguoi-đe-cho-ta-đanh-ai"}},[n._v("#")]),n._v(" Chương 1134: Ngươi để cho ta đánh ai?")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1134: Ngươi để cho ta đánh ai?"),t("br"),t("br"),n._v("Hình đường chủ bọn người có chút phát điên."),t("br"),t("br"),n._v("Chúng ta tận mắt thấy, ngươi một cước đá vào Thanh Hồn thú trên mặt, đưa nó suýt chút nữa đá chết... Giờ phút này, lại còn nói... Là nó ra tay trước!"),t("br"),t("br"),n._v("Có thể lại tán dóc một chút ư?"),t("br"),t("br"),n._v("Nó đến cùng làm sao đắc tội ngươi?"),t("br"),t("br"),n._v("Muốn như vậy đánh?"),t("br"),t("br"),n._v("“Tôn sư... Nếu như Thanh Hồn thú có cái gì làm sai địa phương, xin hãy tha lỗi, nó là Chiến sư đường, tốn hao to lớn đánh đổi mới mời tới... Một khi xảy ra chuyện, Hồn điện sẽ rất khó vận chuyển...”"),t("br"),t("br"),n._v("Lòng tràn đầy bất đắc dĩ, Hình đường chủ giải thích nói."),t("br"),t("br"),n._v("Ngươi nói ngươi một cái siêu cấp thiên tài, cùng một cái thú rõ ràng cái gì sức lực..."),t("br"),t("br"),n._v("“Ây...”"),t("br"),t("br"),n._v("Thấy đối phương quả nhiên không tin, là Thanh Hồn thú động thủ trước, Trương Huyền biết giải thích nhiều hơn nữa cũng vô dụng, lúc này lắc đầu: “Được rồi, ta giúp nó điều trị...”"),t("br"),t("br"),n._v("“Điều trị? Chúng ta Chiến sư đường, có thuốc chữa thương tốt nhất vật, ta báo tin bọn họ chạy tới liền có thể...”"),t("br"),t("br"),n._v("Thấy hắn không có địch ý, thở phào nhẹ nhõm, Hình đường chủ nói."),t("br"),t("br"),n._v("“Dược vật điều trị, khá là phiền toái, vẫn là ta tới đi!”"),t("br"),t("br"),n._v("Trương Huyền khoát tay áo: “Yên tâm đi, ta vẫn là cái y sư, thầy thuốc lòng cha mẹ!”"),t("br"),t("br"),n._v("“Ha ha, ta suýt nữa quên mất, Tôn sư còn là một vị lợi hại y sư...” Hình đường chủ bừng tỉnh đại ngộ, nhịn không được cười lên một tiếng."),t("br"),t("br"),n._v("Trước mắt vị này chính là liền Tề lão kịch độc đều có thể trị hết tồn tại, giúp Thanh Hồn thú trị thương, tự nhiên không có vấn đề."),t("br"),t("br"),n._v("“Đúng vậy a, Tôn sư y thuật Thông Huyền, Thanh Hồn thú nhưng mà trên nhục thể vết thương, không tính là gì...” Tề lão cũng gật gật đầu: “Chúng ta liền cùng một chỗ mở mang kiến thức một chút, Tôn sư như thế nào điều trị a...”"),t("br"),t("br"),n._v("Nói, cười nhẹ nhàng nhìn sang, lời còn chưa dứt, liền thấy thanh niên đi tới Thanh Hồn thú gần, lần nữa một cước đạp tới."),t("br"),t("br"),n._v("Bành!"),t("br"),t("br"),n._v("Thanh Hồn thú bị một cước đá bay lên, thẳng tắp hướng không trung bay đi."),t("br"),t("br"),n._v("“...”"),t("br"),t("br"),n._v("Tề lão, Hình đường chủ, Liêu điện chủ."),t("br"),t("br"),n._v("Không phải nói thầy thuốc lòng cha mẹ ư?"),t("br"),t("br"),n._v("Không phải nói, ngươi là y sư, điều trị càng nhanh ư?"),t("br"),t("br"),n._v("Có như vậy điều trị sao?"),t("br"),t("br"),n._v("Ba người đều nhanh muốn khóc."),t("br"),t("br"),n._v("“Tôn sư... Ngươi đến cùng muốn làm gì...”"),t("br"),t("br"),n._v("Cũng nhịn không được nữa, Hình đường chủ vội vàng đi tới gần, giữ chặt bị đá chính cao hứng thanh niên, trực tiếp hỏi."),t("br"),t("br"),n._v("Nếu không phải đối phương là ân nhân của hắn, càng đối chiến sư đường có cống hiến to lớn, chỉ sợ sớm đã một bàn tay đánh tới."),t("br"),t("br"),n._v("Bành!"),t("br"),t("br"),n._v("Bị hắn kéo một phát, Trương Huyền đành phải ngừng lại, Thanh Hồn thú ngã xuống đất, một mặt tức giận nhìn qua: “Hình đường chủ, ngươi cút sang một bên...”"),t("br"),t("br"),n._v("“A?”"),t("br"),t("br"),n._v("Hình đường chủ ngẩn ngơ, còn chưa kịp tuân hỏi đến tột cùng chuyện gì xảy ra, chỉ thấy đầu này bọn họ tốn hao to lớn đánh đổi mời tới Thánh thú, liếm láp mặt đi tới Trương Huyền gần: “Tôn sư, Tôn ca, Tôn gia gia, có thể lại đá ta mấy cước ư? Chỉ cần ngươi đá ta, ta nhận ngươi làm chủ nhân đều được...”"),t("br"),t("br"),n._v("“...” Hình đường chủ, Hình đường chủ, Liêu điện chủ."),t("br"),t("br"),n._v("Bọn họ sợ vị này Thánh thú, dưới cơn nóng giận, rời đi Chiến sư đường, lúc này mới nghĩ biện pháp khuyên can, không nghĩ tới, cái tên này thế mà ưa thích chịu ngược..."),t("br"),t("br"),n._v("Chỉ cần đá ngươi... Nhận chủ đều được..."),t("br"),t("br"),n._v("Ma đản, lúc trước mời ngươi thời điểm, chảnh chứ cùng ngồi chém gió tự kỷ giống như, làm sao hiện tại thấp kém như vậy?"),t("br"),t("br"),n._v("Am hiểu linh hồn, chẳng lẽ đều biến thái như vậy ư?"),t("br"),t("br"),n._v("Đúng, nếu như có thể nhận ta làm chủ, Chiến sư đường liền lại không cần lo lắng, lúc nào cũng có thể sẽ rời đi..."),t("br"),t("br"),n._v("“Khụ khụ, Thanh Hồn thú, như vậy đi, ngươi nhận ta làm chủ, ta đến đá ngươi...”"),t("br"),t("br"),n._v("Suy nghĩ một chút, đi tới gần, Hình đường chủ nghĩa chính ngôn từ."),t("br"),t("br"),n._v("“...” Thanh Hồn thú."),t("br"),t("br"),n._v("“...” Trương Huyền."),t("br"),t("br"),n._v("“Hiện tại xác định thân phận của ta, không phải Vu Hồn sư đi!”"),t("br"),t("br"),t("span",[t("br"),n._v("Truyệ"),t("br"),n._v("n Của Tuｉ chấm vn"),t("br")]),n._v(" Không để ý tới Hình đường chủ lời nói, Trương Huyền quay đầu nhìn về phía trước mắt Thánh thú."),t("br"),t("br"),n._v("“Ây... Không phải!” Khóe miệng giật một cái, Thanh Hồn thú nói."),t("br"),t("br"),n._v("Nó cảm thấy còn dám nói đối phương là Vu Hồn sư, sẽ bị tại chỗ đánh chết."),t("br"),t("br"),n._v("“Vu Hồn sư? Cái gì Vu Hồn sư?” Nghe được đối thoại, Hình đường chủ nhìn qua."),t("br"),t("br"),n._v("“A, nó cảm thấy linh hồn của ta mạnh mẽ, cho là ta là Vu Hồn sư, mới ra tay với ta...” Trương Huyền nói."),t("br"),t("br"),n._v("“Vu Hồn sư?” Hình đường chủ lắc đầu, nhìn về phía trước mắt Thánh thú: “Xem ra ngươi thật là hiểu lầm, Tôn sư linh hồn sở dĩ mạnh mẽ, là bởi vì... Hắn là một vị hết sức lợi hại Khải Linh sư, nguyên thần của ta trọng thương đều là hắn chữa trị!”"),t("br"),t("br"),n._v("“Khải Linh sư?” Sửng sốt một chút, Thanh Hồn thú cái này mới phản ứng được, tràn đầy xấu hổ."),t("br"),t("br"),n._v("Khải Linh sư đối linh hồn cũng mười phần am hiểu, nếu không, cũng không có khả năng giúp vũ khí khải linh, giúp người tu luyện vững chắc nguyên thần."),t("br"),n._v("Nó thế mà hoài nghi cho rằng Khải Linh sư là Vu Hồn sư, hơn nữa động thủ..."),t("br"),t("br"),n._v("“Ngươi mới vừa nói, gặp qua Vu Hồn sư, cái nghề nghiệp này không phải đã sớm diệt tuyệt ư?” Thấy đối phương không đang hoài nghi, Trương Huyền thở phào nhẹ nhõm, hỏi."),t("br"),t("br"),n._v("Nó từng thấy tận mắt Vu Hồn sư thủ đoạn, chẳng lẽ, theo Thượng Cổ sống sót Vu Hồn sư, loại trừ Mặc Hồn Sinh, còn có những người khác?"),t("br"),t("br"),n._v("“Đúng, năm đó ta khắp nơi bơi thời điểm ra đi, gặp qua một vị Vu Hồn sư, thủ đoạn cực mạnh, có thể thôn phệ người khác hồn phách, tăng lên thực lực của mình, quỷ dị khó lường! Hảo hữu của ta liền bị thôn phệ, ta cũng là dựa dẫm hồn lực mạnh mẽ, mới may mắn chạy trốn... Cho nên, vừa nhìn thấy liên quan tới hồn phách cường đại, liền có hơi quá khích...”"),t("br"),t("br"),n._v("Thanh Hồn thú nói."),t("br"),t("br"),n._v("Trương Huyền cau mày."),t("br"),t("br"),n._v("Vu hồn thủ đoạn cực kỳ phức tạp, quả thực có thôn phệ người khác linh hồn gia tăng bản thân hồn lực thủ đoạn, có điều, cái này mười phần ác độc, hắn chưa hề học qua."),t("br"),t("br"),n._v("“Ngươi ở nơi nào gặp phải?” Nhịn không được hỏi."),t("br"),t("br"),n._v("“Tề Bắc đầm lầy...” Thanh Hồn thú suy nghĩ một chút, nói."),t("br"),t("br"),n._v("“Tề Bắc?”"),t("br"),t("br"),n._v("Trương Huyền nghi hoặc: “Chẳng lẽ cùng Ngoan Nhân có quan hệ?”"),t("br"),t("br"),n._v("Trước đó Tàng Hư muốn giết hắn, thông qua hắn trí nhớ, biết Ngoan Nhân một cái khác phân thân, liền giấu ở Tề Bắc đầm lầy, cái tên này nói Vu Hồn sư cũng là ở nơi đó gặp được, chẳng lẽ, có quan hệ gì?"),t("br"),t("br"),n._v("“Tề Bắc đầm lầy có Vu Hồn sư? Ngươi vì cái gì chưa hề đề cập qua?” Hình đường chủ vẻ mặt cũng là trầm xuống."),t("br"),t("br"),n._v("Chiến sư trách nhiệm không riêng gì đối phó Dị Linh tộc nhân, càng quan trọng hơn là, bảo vệ nhân tộc an nguy."),t("br"),t("br"),n._v("Xuất hiện một đầu sẽ thôn phệ linh hồn Vu Hồn sư, bọn họ có nghĩa vụ đi tiêu diệt, không thể đổ cho người khác."),t("br"),t("br"),n._v("“Ta muốn nâng, đáng tiếc... Chiến sư đường không có linh hồn chống lại tồn tại, thật muốn nói ra đến, sẽ hao tổn càng nhiều Chiến sư!” Thanh Hồn thú nói."),t("br"),t("br"),n._v("“Cái này...” Hình đường chủ hơi đỏ mặt."),t("br"),t("br"),n._v("Rất rõ ràng, đối phương cái này là không tin bọn họ Chiến sư đường thực lực."),t("br"),t("br"),n._v("“Đường chủ không cần cảm giác đến thật không tiện, Vu Hồn sư thủ đoạn quỷ dị khó lường, không là trong tưởng tượng đơn giản như vậy, không có phòng bị đừng nói bình thường Chiến sư, liền xem như ngươi đi qua, đều sẽ ăn thiệt thòi lớn... Lúc trước ta sở dĩ đáp ứng đến các ngươi Hồn điện, một là vì ma luyện Chiến sư, rèn luyện linh hồn của bọn hắn; Thứ hai, cũng là vì ma luyện bản thân, hi vọng một ngày kia, có thể tự mình báo thù!”"),t("br"),t("br"),n._v("Nói đến đây, Thanh Hồn thú ánh mắt lộ ra nồng đậm hận ý."),t("br"),t("br"),n._v("Nhìn thấy nó cái bộ dáng này, Hình đường chủ giờ mới hiểu được tới, nhẹ gật đầu."),t("br"),t("br"),n._v("Khó trách Thanh Hồn thú những năm này, chưa hề coi trọng qua thù lao, nguyên lai là muốn tăng lên hồn lực của mình, tự mình tìm năm đó giết chết bằng hữu hung thủ."),t("br"),t("br"),n._v("“Có thể hay không nói rõ chi tiết một chút tình huống ban đầu, nếu như đối phương thật là Vu Hồn sư lời nói, ta có lẽ có thể giúp một tay!”"),t("br"),t("br"),n._v("Chần chờ một chút, Trương Huyền đạo, hắn Vu hồn tu luyện tới hiện tại, đã không có Thiên Đạo công pháp, không có cách nào tiếp tục đi tới, nhất định phải tìm kiếm pháp quyết mới, lại nói, nếu là cùng Ngoan Nhân có quan hệ, liền càng cần hơn đi qua."),t("br"),t("br"),n._v("“Tôn sư hồn lực mạnh mẽ, ta đều chống chọi không được, nếu như có thể hỗ trợ không còn gì tốt hơn...”"),t("br"),t("br"),n._v("Nghe hắn nói như vậy, Thanh Hồn thú ánh mắt sáng lên."),t("br"),t("br"),n._v("Những năm này, nó khảo hạch qua không ít Chiến sư, không một cái hài lòng, trước mắt vị này, tuổi tác mặc dù không lớn, nhưng hồn lực mạnh mẽ, nó cũng không là đối thủ, thật muốn đối kháng vị kia lời nói, có lẽ thật có khả năng chiến thắng."),t("br"),t("br"),n._v("“Đồng bạn của ta là một đầu thanh y thú, tu vi giống như ta, cũng đạt tới nguyên thần cảnh, chúng ta nghe nói Tề Bắc đầm lầy, có phù hồn hoa, sau khi phục dụng, có thể để người ta hồn lực đại tăng, liền cùng đi.”"),t("br"),t("br"),n._v("“Đã trải qua không ít chuyện, còn không được đến phù hồn hoa, liền gặp vị kia Vu Hồn sư, tới chiến đấu, hắn không địch chúng ta xoay người chạy trốn, ai ngờ nửa đêm, liền lấy hồn phách hình thức đối với chúng ta tiến công, hô ta đồng bạn một tiếng, hồn phách của nó liền bị rút ra xuất thân thể, sau đó bị bắt lại thôn phệ, ta thi triển rất nhiều phương pháp đều không có cứu được...”"),t("br"),t("br"),n._v("“Ngay sau đó hắn tới bắt ta hồn phách, may mắn ta trời sinh am hiểu hồn lực, lúc này mới bảo vệ, thuận lợi chạy trốn... Nếu không, chỉ sợ sớm đã chôn vùi ở đâu, cũng không còn cách nào trở về!”"),t("br"),t("br"),n._v("Nhớ tới cảnh tượng lúc đó, Thanh Hồn thú đến bây giờ đều cảm thấy có chút kinh khủng."),t("br"),t("br"),n._v("Nó am hiểu linh hồn, biết linh hồn cường giả kinh khủng, có thể nói ở mọi chỗ, thậm chí trong lúc ngủ mơ đều có thể đem người hồn phách câu đi, khó lòng phòng bị."),t("br"),t("br"),n._v("“Hô một tiếng hồn phách liền bị rút ra xuất thân thể?”"),t("br"),t("br"),n._v("Trương Huyền cau mày."),t("br"),t("br"),n._v("Hắn theo Mặc Hồn Sinh nơi đó lấy được truyền thừa, còn không có quỷ dị như vậy tiến công thủ đoạn."),t("br"),t("br"),n._v("“Đúng vậy a, đối phương chỉ cần biết rằng tên của ngươi, kêu lên một tiếng, linh hồn liền sẽ bị lập tức rút ra, phản kháng đều không dùng... Mười phần đáng sợ!” Xanh hồn lục soát gật đầu."),t("br"),t("br"),n._v("“Vu Hồn sư quả thực khó để phòng ngự...” Nhớ tới hắn biết rất nhiều thủ đoạn, Trương Huyền nhẹ gật đầu chính muốn nói chuyện, chỉ thấy Ngụy điện chủ vội vã đi tới."),t("br"),t("br"),n._v("“Đường chủ, bọn hắn tới...”"),t("br"),t("br"),n._v("“Tới?” Hình đường chủ nhẹ gật đầu: “Tôn sư, chuyện này chúng ta đằng sau lại thương nghị đi, ta trước đó cùng ngươi nói cái kia đại phiền toái đến...”"),t("br"),t("br"),n._v("“Ta đúng lúc muốn nhìn một chút, đến cùng người nào, dám đối chiến sư đường tìm phiền toái, ta hiện tại liền đi đánh hắn răng rơi đầy đất...”"),t("br"),t("br"),n._v("Trương Huyền nhẹ gật đầu, biết bây giờ không phải là kỹ càng hỏi thăm thời điểm, đi theo đối phương sau lưng, đi ra ngoài."),t("br"),t("br"),n._v("Rời đi Hồn điện, không lâu sau đi tới một quảng trường khổng lồ, còn không có tới gần, liền nghe đến một cái hưng phấn mà tiếng la vang lên."),t("br"),t("br"),n._v("“Lão sư, chúng ta tìm ngươi khắp nơi... Ngươi đã tới!”"),t("br"),t("br"),n._v("Quay đầu nhìn lại, chỉ thấy Vương Dĩnh cùng Trịnh Dương vội vã tiến lên đón."),t("br"),t("br"),n._v("Phía sau bọn họ, Huyền Huyền hội vô số người, sắp xếp chỉnh tề, nhìn thấy hắn tất cả đều đồng loạt ôm quyền: “Hội trưởng!”"),t("br"),t("br"),n._v("“Ừm, các ngươi đã tới vừa vặn, đúng lúc ta muốn cùng một vị cường giả giao đấu, các ngươi cũng có thể thừa cơ quan sát một chút!”"),t("br"),t("br"),n._v("Trương Huyền nhẹ gật đầu."),t("br"),t("br"),n._v("Vốn còn nghĩ, có muốn hay không cùng Hình đường chủ nói một chút, để Huyền Huyền hội người, cũng tới học tập một chút, có điều, vừa nghĩ tới đối phương đang tại phiền lòng, liền không không ngại ngùng mở miệng."),t("br"),t("br"),n._v("Hiện tại bọn hắn tới vừa vặn, cũng liền không cần nói nữa."),t("br"),t("br"),n._v("“Luận võ? Lão sư muốn cùng ai luận võ?” Vương Dĩnh nghi hoặc."),t("br"),t("br"),n._v("“Cùng... Ngươi chờ một chút, ta hỏi một chút!”"),t("br"),t("br"),n._v("Sửng sốt một chút, Trương Huyền quay đầu nhìn về phía sau lưng Hình đường chủ, nhếch miệng cười một tiếng: “Đường chủ, đại phiền toái là cái nào? Ngươi để cho ta đánh ai?”"),t("br"),t("br"),n._v("(Chương trước, Trương Huyền chịu đến oan ức, kỳ thật quả thực là Thanh Hồn thú động thủ trước, lão nhai tìm chút động thái đồ, đều là liên quan tới ai động thủ trước, phát đến công chúng số, mọi người có thể nhìn xem, Wechat lục soát “Hoành Tảo Thiên Nhai” tăng thêm chú ý là đủ.)"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1142"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1144"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);